import React, { useState } from "react";
import axios from "axios";
import Header from "./Components/Header";
import { Container } from "react-bootstrap";
import Footer from "./Components/Footer";
import Menu from "./Components/Menu";
import "./assests/App.css";
import Map from "./Components/Map";
import Details from "./Components/Details";

const App = () => {
  const [json, setJson] = useState(null);
  const [data,setData] = useState(null)

  const getData = (data) => {
    setJson(null);
    if (data !== null){
    axios
      .get(`http://localhost:5000/parcelapi/${data[1]}/${data[0]}`)
      .then((response) => {
        if (!response.data) {
          throw new Error("Empty response or response data is not valid JSON");
        }
        console.log(response.data)
        setJson(response.data[0]);
        setData(response.data)
      })
      .catch((error) => console.error("Error fetching parcels:", error));
  }};
  const info = [data]
  return (
    <>
      <Header />
      <main className="py-3">
        <Container>
          <Menu onSubmit={getData} />
          {json && <Map data={json} />}
          {info && <Details data={info} />}
        </Container>
      </main>
      <Footer />
    </>
  );
};

export default App;
